import React, { useState } from 'react';
import './Dash.css'
import Dashnav from './Dashnav';
import Dashbotmain from './Dashbotmain/Dashbotmain';
import Dashfilter from './DashFilter/Dashfilter';

const Dash = () => {

  const [events, setEvents] = useState();
  return (
    <div className='dash'>
      <div className="dashtop">
          <Dashnav />
      </div>
      <div className="dashbot">
        <div className="dashfilter">
         <Dashfilter events/>
        </div>
        <div className="dashbotmain">
          <Dashbotmain />
        </div>
      </div>
    </div>
  )
}

export default Dash
